svg.script:
function getCnxDirection(cnx) {
    var begIdx = -1, endIdx = -1, ret = undefined;

    for (var Nix = 0 ; Nix < cnx.attributes.length ; Nix++)
        if (cnx.attributes[Nix].nodeName === "inkscape:connection-start")
            begIdx = Nix;
        else
        if (cnx.attributes[Nix].nodeName === "inkscape:connection-end")
            endIdx = Nix;

    // Do not return a connection whose two endpoints are the same!
    if (!(begIdx === -1 || endIdx === -1) &&
         (cnx.attributes[begIdx].nodeValue != cnx.attributes[endIdx].nodeValue))
        ret = { 
            beg : cnx.attributes[begIdx].nodeValue.substring(1),
            end : cnx.attributes[endIdx].nodeValue.substring(1)
        };

    return ret;
}

function className(g) {
    return (g.constructor.toString().match(/function ([^(]*)/)[1] || "");
}

function findChildByType(node, type) {
    if (className(node) === type)
        return node;
    else
    for (Nix = 0 ; Nix < node.childNodes.length ; Nix++)
        if (className(node.childNodes[Nix]) === type)
            return node.childNodes[Nix];

    return undefined;
}

function getText(g) {
    var obj = g, ret = undefined;

    if (obj) obj = findChildByType(obj, "SVGTextElement");
    if (obj) obj = findChildByType(obj, "SVGTSpanElement");
    if (obj) obj = findChildByType(obj, "Text");
    if (obj) ret = obj.nodeValue;

    return ret;
}

function visitedNodes(g) {
    var nodeArray = [ g.id ],
        connectors = document.getElementsByTagName("path"),
        cnxDirection = undefined;

    for (var idxCnx = 0 ; idxCnx < connectors.length ; idxCnx++) {
        cnxDirection = getCnxDirection(connectors[idxCnx]);
        if (undefined !== cnxDirection && cnxDirection.beg === g.id) {
            nodeArray.push(connectors[idxCnx].id);
            nodeArray = nodeArray.concat(visitedNodes(document.getElementById(cnxDirection.end)));
        }
    }

    return nodeArray;
}

function setNodeOpacity(root, opacity) {
    var str = "", matches, newMatches, ar;

    if ((root.style !== undefined) && (root.style.cssText !== undefined)) {
        matches = root.style.cssText.split(";");

        // Remove whitespace
        newMatches = [];
        for (var Nix = 0 ; Nix < matches.length ; Nix++) {
            newMatches.push(matches[Nix].replace(/: */, ":").replace(/^ */, ""));
        }
        matches = newMatches;

        newMatches = {};
        for (var Nix = 0 ; Nix < matches.length ; Nix++) {
            ar = matches[Nix].split(":");
            if (ar.length > 1)
                newMatches[ar[0]] = ar.slice(1).join("");
        }
        matches = newMatches;

        if (matches.stroke !== undefined)
            matches["stroke-opacity"] = opacity;
        if (matches.fill !== undefined)
            matches["fill-opacity"] = opacity;

        for (var Nix in matches)
            str = str + Nix + ": " + matches[Nix] + "; ";
        root.style.cssText = str;
    }
}

function highlightInverse(root, idArray) {
    if (root.id !== undefined) {

        for (var Nix = 0 ; Nix < idArray.length ; Nix++)
            if (root.id === idArray[Nix]) {
                setNodeOpacity(root, "1.0");
                return;
            }

        setNodeOpacity(root, "0.3");
    }
    for (var Nix = 0 ; Nix < root.childNodes.length ; Nix++)
        highlightInverse(root.childNodes[Nix], idArray);
}

function unhighlight(root) {
    if (root.id !== undefined)
        setNodeOpacity(root, "1.0");
    for (var Nix = 0 ; Nix < root.childNodes.length ; Nix++)
        unhighlight(root.childNodes[Nix]);
}

function showDeps(g) {
    unhighlight(document);
    highlightInverse(document, visitedNodes(g, 0));
}

function init() {
    document.onclick = function(e) {
        // Find the nearest "g" node
        for (src = e.target ; src.nodeName !== "g" && src.nodeName !== "svg" ; src = src.parentNode);
        if (src.nodeName === "g")
            showDeps(src);
        else
            unhighlight(document);
    };
}
